import ProductImage from '../png components/products/A white electronic device with a game controller on it..png'
import { AiFillStar } from "react-icons/ai";
import './ProductGroup.css';

const ThumbnailProduct = (props) => {
    return (
        <div className="product-preview">
            <div className="product-img">
                <img src={ProductImage} width='120px' />
            </div>
            <div className="product-detail">
                <p className='product-name'>PlayStation 6 (2026)</p>
                <p className='category'>PlayStation</p>
                <div className='feedback'>
                    <p className='star'><AiFillStar />4.4 |</p>
                    <p className='review'>70+ reviewas</p>
                </div>
                <p className='discount-price'>Rp2.999.999</p>
                <p className='actual-price'>Rp3.982.999</p>
            </div>
        </div>
    )
};

export default ThumbnailProduct;
